\\n<p>It is based around Reclining Hand-To-Big-Toe pose\\u2014a safe posture in which to stretch your hamstrings without putting pressure on your lower back. This pose has 3 variations. The first stretches your hamstrings (of which there are 3\\u2014semimembranosus, semitendinosus and biceps femoris), the second also stretches your groin and adductors and the third stretches your hamstrings, glutes and the outsides of your hips.<\\/p>\\n\\n\\n\\n<p>I look forward to hearing how you find it!<\\/p>\\n\\n\\n\\n<h4 id=\\\"h-level\\\">LEVEL<\\/h4>\\n\\n\\n\\n<ul>\\n<li>Beginner<\\/li>\\n<\\/ul>\\n\\n\\n\\n<h4 id=\\\"h-timing\\\">TIMING<\\/h4>\\n\\n\\n\\n<ul>\\n<li><a href=\\\"https:\\/\\/yoga15.com\\/tag\\/post-workout\\/\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Post-Workout<\\/a><\\/li>\\n\\n\\n\\n<li><a href=\\\"https:\\/\\/yoga15.com\\/tag\\/evening\\/\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Evening<\\/a><\\/li>\\n<\\/ul>\\n\\n\\n\\n<h4 class=\\\"wp-embed-aspect-16-9 wp-has-aspect-ratio\\\">SERIES<\\/h4>\\n\\n\\n\\n<ul type=\\\"video\\\" class=\\\"wp-embed-aspect-16-9 wp-has-aspect-ratio\\\">\\n<li><a href=\\\"https:\\/\\/yoga15.com\\/series\\/yin-for-athletes\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Yin For Athletes<\\/a><\\/li>\\n<\\/ul>\\n\\n\\n\\n<h4 id=\\\"h-objectives\\\">OBJECTIVES<\\/h4>\\n\\n\\n\\n<ul>\\n<li>Stretch the calves and hamstrings. <\\/li>\\n\\n\\n\\n<li>Stretch the feet and ankles.<\\/li>\\n\\n\\n\\n<li>Stretch the groin, adductors, glutes and outer hips. <\\/li>\\n\\n\\n\\n<li>Help to alleviate lower back pain. <\\/li>\\n<\\/ul>\\n\\n\\n\\n<h4 id=\\\"h-poses\\\">POSES<\\/h4>\\n\\n\\n\\n<ul>\\n<li><a href=\\\"https:\\/\\/yoga15.com\\/pose\\/screaming-toe\\/\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Screaming Toe<\\/a><\\/li>\\n\\n\\n\\n<li><a href=\\\"https:\\/\\/yoga15.com\\/pose\\/downward-dog\\/\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Downward&nbsp;Facing&nbsp